import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the Price Range filter to appear
    await page.waitForSelector('.price-filter', { timeout: 5000 });

    // Wait for min price input
    await page.waitForSelector('#minPrice', { timeout: 5000 });
    await page.waitForSelector('#maxPrice', { timeout: 5000 });

    // Set min price to 100
    const minPriceInput = await page.$('#minPrice');
    await minPriceInput.click({ clickCount: 3 });
    await minPriceInput.type('100');

    // Set max price to 500
    const maxPriceInput = await page.$('#maxPrice');
    await maxPriceInput.click({ clickCount: 3 });
    await maxPriceInput.type('500');

    // Take screenshot after entering price range
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_range_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_range_entered.png'));

    // Click the Apply button
    const applyButton = await page.waitForSelector('.apply-filter', { timeout: 5000 });
    await applyButton.click();

    // Wait for product grid/list to update (wait for at least one product in range)
    // Try both grid and list selectors
    let productSelector = '.products-grid .product-card, .products-list .product-card-list';
    await page.waitForSelector(productSelector, { timeout: 5000 });

    // Take screenshot after filter applied
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_filter_applied.png'));

    // Extract product titles and prices currently visible
    const products = await page.$$eval(
      '.products-grid .product-card, .products-list .product-card-list',
      nodes => nodes.map(node => {
        const title = node.querySelector('.product-title')?.innerText || '';
        const priceText = node.querySelector('.product-price')?.innerText || '';
        // Extract price number from priceText like "$328.00"
        const priceMatch = priceText.match(/\$([\d,]+\.\d{2})/);
        const price = priceMatch ? parseFloat(priceMatch[1].replace(/,/g, '')) : null;
        return { title, price };
      })
    );

    // Filter only products in the 100-500 range for verification
    const filteredProducts = products.filter(p => p.price !== null && p.price >= 100 && p.price <= 500);

    return {
      success: true,
      action: "Applied price range filter (100 to 500) and extracted filtered product data",
      extractedData: {
        filteredProducts
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
